    "2016-07-27T22:41:31.342278",nt"name": "port-louisa-national-wildlife-refuge-keithsburg-division-water-and-sediment-quality-summar",nt"isopen":
    false,nt"url": null,nt"notes": "Biologists from the U.S. Fish and Wildlife
    Service surveyed environmental quality at a backwater system of the Upper Mississippi
    River between 1994 and 1996. The U.S. Fish and Wildlife Service monitored water
    quality conditions at Keithsburg Division on May 12, 2012 and June 6, 2012, and
    on June 6, 2012 conducted an assessment of benthic macroinvertebrate diversity as
    a one day benthos blitz. The water samples were tested for ammonia-nitrogen, phosphorous-phosphates,
    and nitrate-nitorgen. The sediment samples were collected with an Ekman dredge and
    processed in the field. The sediment samples were washed through a standard mesh
    to enumerate the invertebrates.",nt"license_title": "License Not Specified",nt"extras":
